// ignore: must_be_immutable
class ImageModel extends Amendable<ImageModel> {
  ImageModel({this.url});

  ImageModel.from(ImageModel other) : this(url: other.url);

  ImageModel copyWith(String? url) {
    return ImageModel(url: url ?? this.url);
  }

  @override
  Future<ImageModel> amendWith(
    Map<String, dynamic>? amendment, {
    ParsingContext? parsingContext,
  }) async {
    return ImageModel(
      url: _urlField.getNullableStringForAmendment(this, amendment),
    );
  }

  static ImageModel fromJson(
    Map<String, dynamic>? json, {
    ParsingContext? parsingContext,
  }) {
    if (json == null) {
      return ImageModel();
    }
    return ImageModel(url: _urlField.getNullableString(json));
  }

  factory ImageModel.fromRow(Row row) {
    return ImageModel(url: _urlField.getNullableStringFromRow(row));
  }

  final String? url;

  static Future<ImageModel> fromPrompt() async {
    var json = await Amendable.promptForJson(staticFields);
    if (json == null) {
      return ImageModel();
    }
    if (json.length != staticFields.length) {
      return ImageModel();
    }

    return ImageModel.fromJson(json);
  }

  @override
  List<FieldBase<ImageModel>> get fields => staticFields;

  static FieldBase<ImageModel> get _urlField => Field.infer(
    (p) => p.url,
    'Url',
    'The URL of the image',
    sqliteName: 'image_url',
    shqlName: 'url',
    formatEx: (p) => showAsciiArt(p),
  );

  static final List<FieldBase<ImageModel>> staticFields = [_urlField];

  static final AsciiArtConverter _asciiArtConverter = AsciiArtConverter(
    width: 75,
    charset: CharSet.standart,
    invert: false,
    colorMode: ColorMode.trueColor,
  );

  static String showAsciiArt(ImageModel p) {
    if (p._asciiArt.isEmpty && !p._downloadInPlace) {
      final stackTrace = StackTrace.current.toString();
      final isProgrammatic =
          stackTrace.contains('print(') ||
          stackTrace.contains('debugPrint') ||
          stackTrace.contains('join(') ||
          stackTrace.contains('interpolation') ||
          stackTrace.contains('Exception') ||
          stackTrace.contains('_debugger') ||
          stackTrace.contains('inspector');
      if (isProgrammatic) {
        return p._asciiArt;
      }

      var url = p.url;
      if (url == null) {
        return p._asciiArt;
      }
      final proxyUrl = Uri.parse(
        'https://corsproxy.io/?${Uri.encodeFull(url)}',
      );
      final spinner = CliSpin(
        text: 'Downloading image from $proxyUrl ...\n',
        spinner: CliSpinners.dots,
      ).start();
      p._downloadInPlace = true;

      http
          .get(proxyUrl)
          .then((response) async {
            p._asciiArt =
                "\n${await _asciiArtConverter.convert(response.bodyBytes)}";
            spinner.stop();
            await Terminal.printLnAndRedisplayCurrentPrompt(p._asciiArt);
          })
          .catchError((error) async {
            p._asciiArt = """

Displaying placeholder image:

$_placeholderAsciiArt""";

            spinner.stop();
            await Terminal.printLnAndRedisplayCurrentPrompt("""
Failed to download image:
$error
${p._asciiArt}""");
          })
          .whenComplete(() async {
            p._downloadInPlace = false;
          });
    }
    return p._asciiArt;
  }

